import Home from './pages/Home/Home';
import Content from './pages/Content/Content';
import CreatePost from '../src/components/CreatePost.js';

import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Home />
      <Content />
      <Routes>
        <Route path="/post" element={<CreatePost />} />
      </Routes>
    </div>
  );
}

export default App;
